import React , {Component} from "react";


class App extends Component { 
  constructor(){
    super();
  }

  addName(){
    if(this.state.arr.length > this.state.counter){
      this.setState( e => {
          return {counter : e.counter + 1} 
      })
      this.setState( e => {
        return {newarr : this.state.newarr.push({a:this.state.arr[this.state.counter]})} 
      })
      //this.state.newarr.a = this.state.arr[this.state.counter]
      console.log(this.state.newarr)
    } 
  }

  mapping(obj){
    const info =  Object.keys(obj).forEach(()=> <Items  items={obj.a} /> );
    return info;
  }

  render(){
    return (
      <div className="App"> 
        <button onClick={this.addName} className="btn"> Click </button>
        {this.mapping(this.state.newarr)}
      </div>
    );
  }
}

export default App;
